import { Routes, Route } from 'react-router-dom'
import Login from './Login'
import Stats from './Statistiques';
function App() {
  return (
    <div>
      <Routes>
        <Route path='/' exact render={() => <Login />} />
        <Route path='/stats' exact render={() => <Stats />} />
      </Routes>
    </div>
  );
}

export default App;
